promptA: .asciiz "crab fall here"
.eqv FRAME_BASE 0x10008000
.eqv MAX_ADDRESS 0x1004049C
#.eqv MS_PER_FRAME 33
.eqv FRAME_HEIGHT 512
.eqv FRAME_WIDTH 512



.eqv RED 0x00ee1420
.eqv BLACK 0x00000001
.eqv BACKGROUND_BLUE 0x0096d9e9
.eqv GRAVITY 1
.eqv BOTTOM_GREATER_THAN 60928 #LAST ROW INDEX - HEIGHT
.eqv INIT_CRAB_POS 55828 #change later



.text
main: ### $t9 stores current, $t8 stores previous
	li $t9, FRAME_BASE # $t9 stores graph top left corner address
	
	
	### initial crab position 
	#li $t0, INIT_CRAB_POS
	#add $t9, $t9, $t0
	addi $t9, $t9, 4
	
	#initial drawings
	jal set_screen_BACKGROUND
	
	la $a0, promptA ## debugger
	li $v0, 4
	syscall 
	
	jal loadCrabColours
	j GAME_LOOP
	
	j END
	

############ CHECK COLLISIONS######################
CHECK_COLLISIONS:
### CHECK BOTTOM COLLISION
CHECK_BOTTOM_COLLISIONS:
	add $t0, $t9, $zero #t0 has top left corner
	### store address of bottom row in t0
	addi $t0, $t9, 4096
	#t1 for left foot pixel underneath, #t2 for right foot pixel underneath
	addi $t1, $t0, 4
	addi $t2, $t0, 48
	#t3, if left is not blue 
	lw $t3, 0($t1)
	bne $t3, 0x0096d9e9, NO_CHANGE #BACKGROUND BLUE
	
	lw $t3, 0($t2)
	bne $t3, 0x0096d9e9, NO_CHANGE
	
	jr $ra
	
	
	
GAME_LOOP:
	
	
	jal CHECK_COLLISIONS
	la $a0, promptA ## debugger
	li $v0, 4
	syscall 
	jal DO_GRAVITY
	jal eraseCrab
	jal loadCrabColours
	j GAME_LOOP

NO_CHANGE: 
	j END ### jump back to check for keyboard input
DO_GRAVITY:
	
	li $t0, GRAVITY
	li $t1, FRAME_WIDTH
	mult $t0, $t1
	mflo $t1
	add $t8, $t9, $zero #save to last position
	add $t9, $t9,$t1 #lower crab
	
	jr $ra
	

set_screen_BACKGROUND:
	la $t3, background
	li $t0, FRAME_BASE
	addi $t2, $t0, 70559 #max address
	j setPixel_SCREEN


setPixel_SCREEN:
	lw $t1, ($t3)
    	sw $t1, 0($t0) # set $t2 to white
   	addi $t0, $t0, 4 # increment $t2 to next index
    	addi $t3, $t3, 4 #increment background to next value
    	ble $t0, $t2, setPixel_SCREEN #$t2 is adress of bottom right corn of the image
    	
    	jr $ra 
	

loadCrabColours:	
	li $t1, BLACK 
	li $t0, RED
	add $t7, $t9, $zero #copy current crab position
	j Draw_Crab

eraseCrab:
	li $t0, BACKGROUND_BLUE
	li $t1, BACKGROUND_BLUE
	add $t7, $t8, $zero #copy prev. crab position
	j Draw_Crab

Draw_Crab:	
	sw $t0, 0($t7)
	sw $t0, 52($t7)

	sw $t0, 512($t7)
	sw $t0, 516($t7)
	sw $t0, 560($t7)
	sw $t0, 564($t7)

	sw $t0, 1024($t7)
	sw $t0, 1028($t7)
	sw $t1, 1044($t7)
	sw $t1, 1056($t7)
	sw $t0, 1072($t7)
	sw $t0, 1076($t7)

	sw $t0, 1544($t7)
	sw $t0, 1552($t7)
	sw $t0, 1556($t7)
	sw $t0, 1560($t7)
	sw $t0, 1564($t7)
	sw $t0, 1568($t7)
	sw $t0, 1572($t7)
	sw $t0, 1580($t7)

	sw $t0, 2060($t7)
	sw $t0, 2064($t7)
	sw $t0, 2068($t7)
	sw $t0, 2072($t7)
	sw $t0, 2076($t7)
	sw $t0, 2080($t7)
